import React from "react";
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Page from './link';
import Post from './Post';

const Router = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="board/*" element={<Page />}>
                    <Route path=":articleId" element={<Post/>}/>
                </Route>
            </Routes>
        </BrowserRouter>
    )
}
